const { Sequelize, Model } = require('sequelize');

module.exports = (sequelize,DataTypes) => {
    class StoreItems extends Model {}

    StoreItems.init(
        {
            id: {
                type: DataTypes.INTEGER,
                allowNull: false,
                primaryKey: true,
                autoIncrement: true,
            },
            name: {
                type: DataTypes.STRING(50),
                allowNull: false,
            },
            description: {
                type: DataTypes.STRING(255),
                allowNull: false,
            },
            picture: {
                type: DataTypes.BLOB("long"),
                allowNull: false,
            },
            price: {
                type: DataTypes.INTEGER,
                allowNull: false,
                defaultValue: 100,
            },
            amount: {
                type: DataTypes.INTEGER,
                allowNull:true,
                defaultValue:null
            }
        },
        {
            sequelize,
            tableName: "storeItems",
            modelName: "StoreItems",
            timestamps: false,
        }
    );

    StoreItems.initializeStoreItems = async () => {
        const defaultStoreItems = [
            {
                name: "Időfordító Zseton",
                description:
                    "Ha lemaradtál egy napi feladatról visszatérhetsz rá, a token segítségével!",
                picture: "data:image/png;base64,",
                price: 100,
                amount: null
            },
            {
                name: "Math Solve póló",
                description: "Tavaszi kollekció Limitált kiadás, a készlet erejéig kiváltható",
                picture: "data:image/png;base64,",
                price: 12000,
                amount: 0
            },
            {
                name: "Math Solve bögre",
                description: "Tavaszi kollekció Limitált kiadás, a készlet erejéig kiváltható",
                picture: "data:image/png;base64,",
                price: 9000,
                amount: 0
            },
            {
                name: "Math Solve füzet",
                description: "Tavaszi kollekció Limitált kiadás, a készlet erejéig kiváltható",
                picture: "data:image/png;base64,",
                price: 15000,
            },
        ];

        for (const item of defaultStoreItems) {
            await StoreItems.findOrCreate({
                where: { name: item.name },
                defaults: item,
            });
        }
    };

    return StoreItems;
};
